PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE m_active_skill(
  id INTEGER NOT NULL,
  skill_type INTEGER NOT NULL,
  skill_rarity_type INTEGER NOT NULL,
  skill_master_id INTEGER NOT NULL,
  name TEXT NOT NULL,
  description TEXT NOT NULL,
  sp_gauge_point INTEGER NOT NULL,
  trigger_probability INTEGER NOT NULL,
  icon_asset_path TEXT,
  thumbnail_asset_path TEXT NOT NULL,
  PRIMARY KEY (id),
  FOREIGN KEY (skill_master_id) REFERENCES m_skill(id)
);
COMMIT;
